  const diffAbs = local - national;
  const diffPct = national !== 0 ? diffAbs / national * 100 : null;
  let etiqueta = "similar al promedio nacional";
  if (diffPct != null) {
    const absPct = Math.abs(diffPct);
    if (absPct < 5) {
      etiqueta = "muy cercana al promedio nacional";
    } else if (absPct < 15) {
      etiqueta = diffPct > 0 ? "moderadamente por encima del promedio nacional" : "moderadamente por debajo del promedio nacional";
    } else {
      etiqueta = diffPct > 0 ? "claramente por encima del promedio nacional" : "claramente por debajo del promedio nacional";
    }
  }
  return {
    valor_local: local,
    valor_nacional: national,
    diferencia_absoluta: diffAbs,
    diferencia_porcentual: diffPct,
    interpretacion: etiqueta
  };
